import React, { Component } from "react";
import "./Products.css";

export default class Products extends Component {
  state = {
    products: [1, 2, 3]
  };

  render() {
    return (
      <div>
        <h2>Products</h2>
        <ul>
          {this.state.products.map((el, index) => (
            <li key={index}>a</li>
          ))}
        </ul>
      </div>
    );
  }
}
